CREATE DEFINER=`root`@`localhost` PROCEDURE `Material_Insert`(
	in _name 		varchar(255), 
    in _owner 		int(11),
    in _code 		varchar(255),
    in _use_for 		varchar(255),
    in _create_time 	double,
    in _modify_time 	double,
    in _density		double,
    in _tc_is_fun	tinyint(1),
    in _sh_is_fun	tinyint(1),
    in _tc_list		varchar(4002),
    in _sh_list		varchar(4002),
    in _remark		varchar(1000),
    in _share		tinyint(1)
)
BEGIN
	insert into material(name,owner,code,use_for,create_time,modify_time,density,remark,tc_is_fun,sh_is_fun,tc_list,sh_list,share) 
    values(_name,_owner,_code,_use_for,_create_time,_modify_time,_density,_remark,_tc_is_fun,_sh_is_fun,_tc_list,_sh_list,_share);
    select max(id) from material;
END ;;
