CREATE DEFINER=`root`@`localhost` PROCEDURE `Material_Search`(
    in	_name		varchar(255),
    in	_code		varchar(255),
    in	_usefor		varchar(255),
    in	_shared		tinyint(1)
)
BEGIN
    select material.id,material.name,material.code,material.use_for,user.name as owner,material.remark
    from material left join user on (material.owner=user.id)
    where 
